import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const ListChapter = () => {
  return (
    <>
      <Row>
        <Col xl={6}>Chương 1: Đêm</Col>
        <Col xl={6}>Chương 2: Đêm</Col>
      </Row>
    </>
  );
};

export default ListChapter;
